import React , { Component }from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'
import { Table, Divider, Tag } from 'antd'



class List extends Component {
    constructor(props) {
        super(props)
        this.getList = this.getList.bind(this)
        this.state = {
            url: theUrl + '/getAdminList',
            columns: [{
                title: 'ID',
                dataIndex: 'id',
                key: 'id',
              }, {
                title: 'Username',
                dataIndex: 'username',
                key: 'username',
              }, {
                title: 'Phone',
                dataIndex: 'phone',
                key: 'phone',
            }],
        }
    }
    componentDidMount() {
        this.getList(this.props.dispatch, this.state.url)
    }   

    getList = (dispatch, getAdminList) => {

        fetch(getAdminList)
        .then(res => { return res.json() })
        .then(res => {
            dispatch({
                type: 'INIT',
                res
            })
            console.log(res)
        })
    }

    render() {
        return(
            <div>

                <Table 
                    dataSource={this.props.list}
                    columns={this.state.columns}
                />
            </div>
        )
    }
}


const mapStateToProps = state => ({
    list: state.list
})
export default connect(
    mapStateToProps
)(List);
